description:
Dan Deacon's newest album Gliss Riffer was released on February 24th, 2015 and has yet to be found on the bay.

What a travesty, given that Dan's own website links to a search for the album.

Well here it is folks, enjoy and if you ever get the chance, please see him live, he is amazing. - Jakeosaur


Track List:

1.	&quot;Feel the Lightning&quot;
2.	&quot;Sheathed Wings&quot;
3.	&quot;When I Was Done Dying&quot;
4.	&quot;Meme Generator&quot;
5.	&quot;Mind on Fire&quot;
6.	&quot;Learning to Relax&quot;
7.	&quot;Take It to the Max&quot;
8.	&quot;Steely Blues&quot;
